import styled from "styled-components";
import { device } from "../../assets/styles/device";

export const DivHeaderTable = styled.div`
  div {
    display: flex;
    justify-content: flex-start;
    width: 30%;
    border: 1px solid red;
    margin: 20px;
  }
`;
